import React from 'react'
import "./index.css"

const crntTime = new Date(2020, 9, 15 , 15).getHours();
const style = {}

let getData = "";
  if (crntTime >= 1 && crntTime < 12) {
    getData = "Good Morning"
    style.color = "blue"
  } else if (crntTime >= 1 && crntTime < 19) {
    getData = "Good Afternon"
    style.color = "red"
  } else {
    getData = "Good Night"
  }

const App = () => {
 
  return (
    <>
      <div className="container_now">
        <div className="heading">
          <h1>HELLO DEAR  <span style={style}>{getData}</span></h1>
        
        </div>
      </div>
    </>
  )
}

export default App;
